import React, { Component } from 'react';
import './App.css';
import CarMakesList from './components/CarMakesList'

class App extends Component {


  render() {
    const { isLoading, makes } = this.state
    if (isLoading) {
      return <div>Loading...</div>
    }
    return (
      <div>
        <form className="car-form">

          <input type="text" className="search" placeholder="search your car..." />
          <CarMakesList makes={makes}/>
        </form>
      </div>
    );
  }

}

export default App;
